Please convert the following React component into plain HTML.

Component Description:  
The component renders a pricing table with three columns (Basic, Pro, Premium).  
1. Each column includes a title, price, and a "Choose Plan" button.  
2. Column titles are bold and centered.  
3. The background of the selected column (Pro) is light blue (`#f0f8ff`).  

React Component Code:  
import React from 'react';

function PricingTable() {
  return (
    <div style={{ display: 'flex', justifyContent: 'center', gap: '20px', padding: '20px' }}>
      {['Basic', 'Pro', 'Premium'].map((plan, index) => (
        <div key={index} style={{ textAlign: 'center', padding: '20px', border: '1px solid #ddd', backgroundColor: plan === 'Pro' ? '#f0f8ff' : 'white', borderRadius: '5px', width: '25%' }}>
          <h3>{plan}</h3>
          <p>$10/month</p>
          <button style={{ backgroundColor: '#007bff', color: 'white', border: 'none', padding: '10px 20px', borderRadius: '5px' }}>Choose Plan</button>
        </div>
      ))}
    </div>
  );
}

export default PricingTable;


