Please convert the following React component into plain HTML.

Component Description:  
The component displays three notification cards (Success, Warning, Error) side-by-side.  
1. Each card has a background color corresponding to its status:  
   - Green (`#28a745`) for "Success"  
   - Yellow (`#ffc107`) for "Warning"  
   - Red (`#dc3545`) for "Error"  
2. Cards are evenly spaced and horizontally aligned.  
3. The text inside the cards is white and centered.  

React Component Code:  
import React from 'react';

function NotificationBar() {
  const notifications = [
    { status: 'Success', color: '#28a745' },
    { status: 'Warning', color: '#ffc107' },
    { status: 'Error', color: '#dc3545' }
  ];

  return (
    <div style={{ display: 'flex', justifyContent: 'space-around', padding: '20px' }}>
      {notifications.map((note, index) => (
        <div key={index} style={{ backgroundColor: note.color, color: 'white', padding: '20px', borderRadius: '5px', width: '30%', textAlign: 'center' }}>
          <p>{note.status}</p>
        </div>
      ))}
    </div>
  );
}

export default NotificationBar;


