Please convert the following React component into plain HTML.

Component Description:  
The component renders a pricing table with three columns: Basic, Standard, and Premium.  
1. Each column is displayed in a card with a title, a list of features, and a "Select" button.  
2. The columns are horizontally aligned with equal spacing.  
3. The "Basic" card has a light gray background (`#f8f9fa`), "Standard" has blue (`#007bff`), and "Premium" has gold (`#ffc107`).  
4. The title text is centered and white.  

React Component Code:  
import React from 'react';

function PricingTable() {
  const plans = [
    { title: 'Basic', color: '#f8f9fa', textColor: '#000' },
    { title: 'Standard', color: '#007bff', textColor: '#fff' },
    { title: 'Premium', color: '#ffc107', textColor: '#000' }
  ];

  return (
    <div style={{ display: 'flex', justifyContent: 'space-between', padding: '20px' }}>
      {plans.map((plan, index) => (
        <div key={index} style={{ backgroundColor: plan.color, color: plan.textColor, padding: '20px', borderRadius: '10px', width: '30%', textAlign: 'center' }}>
          <h2>{plan.title}</h2>
          <ul style={{ listStyle: 'none', padding: 0 }}>
            <li>Feature 1</li>
            <li>Feature 2</li>
            <li>Feature 3</li>
          </ul>
          <button style={{ backgroundColor: '#000', color: '#fff', padding: '10px', border: 'none', borderRadius: '5px' }}>Select</button>
        </div>
      ))}
    </div>
  );
}

export default PricingTable;


