Please convert the following React component into plain HTML.

Component Description:  
The component displays a progress bar:  
1. A gray (`#e9ecef`) outer container representing the full progress.  
2. A filled blue bar (`#007bff`) representing 70% progress.  
3. The progress value ("70%") is displayed in white at the center of the blue bar.  

React Component Code:  
import React from 'react';

function ProgressBar() {
  return (
    <div style={{ backgroundColor: '#e9ecef', width: '100%', height: '30px', borderRadius: '5px', overflow: 'hidden' }}>
      <div style={{ backgroundColor: '#007bff', width: '70%', height: '100%', display: 'flex', alignItems: 'center', justifyContent: 'center', color: 'white' }}>
        70%
      </div>
    </div>
  );
}

export default ProgressBar;


