Please convert the following React component into plain HTML.

Component Description:  
The component displays a vertically centered login form with the following features:  
1. A light blue (`#e3f2fd`) background for the form container.  
2. Two text inputs for "Username" and "Password" with rounded borders.  
3. A green "Login" button (`#28a745`) centered below the inputs.  

React Component Code:  
import React from 'react';

function LoginForm() {
  return (
    <div style={{ backgroundColor: '#e3f2fd', padding: '30px', width: '300px', margin: 'auto', borderRadius: '10px', textAlign: 'center' }}>
      <input type="text" placeholder="Username" style={{ width: '100%', padding: '10px', marginBottom: '15px', borderRadius: '5px', border: '1px solid #ccc' }} />
      <input type="password" placeholder="Password" style={{ width: '100%', padding: '10px', marginBottom: '15px', borderRadius: '5px', border: '1px solid #ccc' }} />
      <button style={{ backgroundColor: '#28a745', color: 'white', padding: '10px 20px', border: 'none', borderRadius: '5px' }}>Login</button>
    </div>
  );
}

export default LoginForm;


